function formatLinkForPaginationURLMyPhoto(){var form=$("#my_photos_search");var url=form.attr("action");$("div.my_photos").find("a").each(function(){var linkElement=$(this);var page=linkElement.html();linkElement.attr({"page":page,"href":"javascript:;"});linkElement.click(function(){form.attr("action",url+"?page="+$(this).attr('page'));searchMyStories();});});}
